'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdone, and they were ready for a break and to see their families. Elon said, ‘I would tell those people they will get to see their families a lot when we go bankrupt.’ I was like, ‘Wow,’ but I got it. I had come out of a military culture, and you just have to make your objective happen.” Employees were required to meet at 7 A.M. every Thursday morning for bill-of-materials updates. They had to know the price of every part and have a cogent plan for getting parts cheaper. If the motor cost $6,500 a pop at the end of December, Musk wanted it to cost $3,800 by April. The costs were plotted and analyzed each month. “If you started falling behind, there was hell to pay,” Popple said. “Everyone could see it, and people lost their jobs when they didn’t deliver. Elon has a mind that’s a bit like a calculator. If you put a number on the projector that does not make sense, he will spot it. He doesn’t miss details.” Popple found Musk’s style aggressive, but he liked that Musk would listen to a well-argued, analytical point and often change his mind if given a good enough reason. “Some people thought Elon was too tough or hot-tempered or tyrannical,” Popple said. “But these were hard times, and those of us close to the operational realities of the company knew it. I appreciated that he didn’t sugarcoat things.”\n\nSeptember 9, 2018\n\u001c193\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c‘it was the standard way things had always been done,’ he’d kick you out of a meeting fast. He’d say, ‘I never want to hear that phrase again. What we have to do is fucking hard and half-assing things won’t be tolerated.’ He just destroys you and, if you survive, he determines if he can trust you. He has to understand that you’re as crazy as he is.” This ethos filtered through the entire company, and everyone quickly understood that Musk meant business.\n\nSeptember 9, 2018\n\u001c194\n\u0011\n\u0011\n\n\n8         PAIN, SUFFERING, AND SURVIVAL\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDowney really wanted a peek inside Musk’s psyche. The men walked, sat in Musk’s office, and had lunch. Downey appreciated that Musk was not a foul-smelling, fidgety, coder whack job. What Downey picked up on instead were Musk’s “accessible eccentricities” and the feeling that he was an unpretentious sort who could work alongside the people in the factory. Both Musk and Stark were the type of men, according to Downey, who “had seized an idea to live by and something to dedicate themselves to” and were not going to waste a moment. When he returned to the Iron Man production office, Downey asked that Favreau be sure to place a Tesla Roadster in Tony Stark’s workshop. On a superficial level, this would symbolize that Stark was so cool and connected that he could get a Roadster before it even went on sale. On a deeper level, the car was to be placed as the nearest object to Stark’s desk so that it formed something of a bond between the actor, the character, and Musk.\n\nSeptember 10, 2018\n\u001c199\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHis team of engineers had remained camped out on the island, preparing the Falcon 1 for another run. A typical company would focus just on the task at hand. Not SpaceX. It had shipped the Falcon 1 to Kwaj in April with one set of engineers and then put another group of engineers on a new project to develop the Falcon 9, a nine-engine rocket that would take the place of the Falcon 5 and serve as a possible replacement to the retiring space shuttle. SpaceX had yet to prove it could get to space successfully, but Musk kept positioning it to bid on big-ticket NASA contracts.\n\nSeptember 11, 2018\n\u001c213\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe failed launch left many SpaceX employees shattered. “It was so profound seeing the energy shift over the room in the course of thirty seconds,” said Dolly Singh, a recruiter at SpaceX. “It was like the worst fucking day ever. You don’t usually see grown-ups weeping, but there they were. We were tired and broken emotionally.” Musk addressed the workers right away and encouraged them to get back to work. “He said, ‘Look. We are going to do this. It’s going to be okay. Don’t freak out,’” Singh recalled. “It was like magic. Everyone chilled out immediately and started to focus on figuring out what just happened and how to fix it. It went from despair to hope and focus.” Musk put up a positive front to the public as well. In a statement, he said that SpaceX had another rocket waiting to attempt a fourth launch and a fifth launch planned shortly after that.\n\nSeptember 11, 2018\n\u001c214\n\u0011\n\u0011"},{"ty":"te","id":"i.35","spi":17845},{"ty":"te","id":"i.36","spi":19204},{"ty":"te","id":"i.37","spi":19743},{"ty":"te","id":"i.38","spi":20760},{"ty":"te","id":"i.39","spi":21378},{"ty":"as","st":"paragraph","si":17836,"ei":17836,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":17837,"ei":17837,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":17838,"ei":17838,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":17840,"ei":17840,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":17842,"ei":17842,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"col_wv":54.0,"col_wt":0}]}},"tbls_bw":0.0}},{"ty":"as","st":"cell","si":17844,"ei":17844,"sm":{"cell_pr_i":fal