false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime('', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunk = [{"ty":"is","ibi":22277,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfinally, around nine minutes into its journey, the Falcon 1 shut down just as planned and reached orbit, making it the first privately built machine to accomplish such a feat. It took six years—about four and half more than Musk had once planned—and five hundred people to make this miracle of modern science and business happen.\n\nSeptember 11, 2018\n\u001c218\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I was just getting pistol-whipped,” Musk said. “There was a lot of schadenfreude at the time, and it was bad on so many levels. Justine was torturing me in the press. There were always all these negative articles about Tesla, and the stories about SpaceX’s third failure. It hurt really bad. You have these huge doubts that your life is not working, your car is not working, you’re going through a divorce and all of those things. I felt like a pile of shit. I didn’t think we would overcome it. I thought things were probably fucking doomed.” When Musk ran through the calculations concerning SpaceX and Tesla, it occurred to him that only one company would likely even have a chance at survival.\n\nSeptember 11, 2018\n\u001c220\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFor Gracias, the Tesla and SpaceX investor and Musk’s friend, the 2008 period told him everything he would ever need to know about Musk’s character. He saw a man who arrived in the United States with nothing, who had lost a child, who was being pilloried in the press by reporters and his ex-wife and who verged on having his life’s work destroyed. “He has the ability to work harder and endure more stress than anyone I’ve ever met,” Gracias said. “What he went through in 2008 would have broken anyone else. He didn’t just survive. He kept working and stayed focused.” That ability to stay focused in the midst of a crisis stands as one of Musk’s main advantages over other executives and competitors. “Most people who are under that sort of pressure fray,” Gracias said. “Their decisions go bad. Elon gets hyperrational. He’s still able to make very clear, long-term decisions. The harder it gets, the better he gets. Anyone who saw what he went through firsthand came away with more respect\n\nSeptember 11, 2018\n\u001c225\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cfor the guy. I’ve just never seen anything like his ability to take pain.”\n\nSeptember 11, 2018\n\u001c226\n\u0011\n\u0011\n\n\n9         LIFTOFF\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhere the Falcon 1 blasting off from Kwajalein was the work of a start-up, the Falcon 9 taking off from Vandenberg is the work of an aerospace superpower. SpaceX can undercut its U.S. competitors—Boeing, Lockheed Martin, Orbital\n\nSeptember 13, 2018\n\u001c230\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSciences—on price by a ridiculous margin. It also offers U.S. customers a peace of mind that its rivals can’t. Where these competitors rely on Russian and other foreign suppliers, SpaceX makes all of its machines from scratch in the United States. Because of its low costs, SpaceX has once again made the United States a player in the worldwide commercial launch market. Its $60 million per launch cost is much less than what Europe and Japan charge and trumps even the relative bargains offered by the Russians and Chinese, who have the added benefit of decades of sunk government investment into their space programs as well as cheap labor.\n\nSeptember 11, 2018\n\u001c230\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccorporate structure—to a staid industry. People who know Musk well tend to describe him more as a general than a CEO, and this is apt. He’s built an engineering army by having the pick of just about anyone in the business that SpaceX wants.\n\nSeptember 12, 2018\n\u001c234\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“The recruiting pitch was SpaceX is special forces,” she said. “If you want as hard as it gets, then great. If not, then you shouldn’t come here.” Once at SpaceX, the new employees found out very quickly if they were indeed up for the challenge. Many of them would quit within the first few months because of the ninety-plus-hour workweeks. Others quit because they could not handle just how direct Musk and the other executives were during meetings. “Elon doesn’t know about you and he hasn’t thought through whether or not something is going to hurt your feelings,” Singh said. “He just knows what the fuck he wants\n\nSeptember 12, 2018\n\u001c236\n\u0011\n\u0011"},{"ty":"te","id":"i.40","spi":22286},{"ty":"te","id":"i.41","spi":22656},{"ty":"te","id":"i.42","spi":23395},{"ty":"te","id":"i.43","spi":24430},{"ty":"te","id":"i.44","spi":24565},{"ty":"te","id":"i.45","spi":24834},{"ty":"te","id":"i.46","spi":25517},{"ty":"te","id":"i.47","spi":25798},{"ty":"as","st":"paragraph","si":22277,"ei":22277,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":22278,"ei":22278,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true