it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":26420,"ei":26439,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime('', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunk = [{"ty":"is","ibi":26447,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cdone. People who did not normalize to his communication style did not do well.”\n\nSeptember 12, 2018\n\u001c236\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“His vision is so clear,” Singh said. “He almost hypnotizes you. He gives you the crazy eye, and it’s like, yes, we can get to Mars.”\n\nSeptember 12, 2018\n\u001c237\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe factory is a temple devoted to what SpaceX sees as its major weapon in the rocket-building game, in-house manufacturing. SpaceX manufactures between 80 percent and 90 percent of its rockets, engines, electronics, and other parts. It’s a strategy that flat-out dumbfounds SpaceX’s competitors, like United Launch Alliance, or ULA, which openly brags about depending on more than 1,200 suppliers to make its end products.\n\nSeptember 12, 2018\n\u001c240\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe equipment at SpaceX tends to be built out of readily available consumer electronics as opposed to “space grade” equipment used by others in the industry. SpaceX has had to work for years to prove to NASA that standard electronics have gotten good enough to compete with the more expensive, specialized gear trusted in years\n\nSeptember 12, 2018\n\u001c241\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cpast. “Traditional aerospace has been doing things the same way for a very, very long time,” said Drew Eldeen, a former SpaceX engineer. “The biggest challenge was convincing NASA to give something new a try and building a paper trail that showed the parts were high enough quality.” To prove that it’s making the right choice to NASA and itself, SpaceX will sometimes load a rocket with both the standard equipment and prototypes of its own design for testing during flight. Engineers then compare the performance characteristics of the devices. Once a SpaceX design equals or outperforms the commercial products, it becomes the de facto hardware.\n\nSeptember 13, 2018\n\u001c241\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAt SpaceX, he had to pick things up on the job. Musk initially relied on textbooks to form the bulk of his rocketry knowledge. But as SpaceX hired one brilliant person after another, Musk realized he could tap into their stores of knowledge. He would trap an engineer in the SpaceX factory and set to work grilling him about a type of valve or specialized material. “I thought at first that he was challenging me to see if I knew my stuff,”\n\nSeptember 12, 2018\n\u001c243\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001csaid Kevin Brogan, one of the early engineers. “Then I realized he was trying to learn things. He would quiz you until he learned ninety percent of what you know.”\n\nSeptember 12, 2018\n\u001c243\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn regards to time, Musk may well set more aggressive delivery targets for very difficult-to-make products than any executive in history. Both his employees and the public have found this to be one of the more jarring aspects of Musk’s character. “Elon has always been optimistic,” Brogan said. “That’s the nice word. He can be a downright liar about when things need to get done. He will pick the most aggressive time schedule imaginable assuming\n\nSeptember 12, 2018\n\u001c244\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ceverything goes right, and then accelerate it by assuming that everyone can work harder.” Musk has been pilloried by the press for setting and then missing product delivery dates. It’s one of the habits that got him in the most trouble as SpaceX and Tesla tried to bring their first products to market. Time and again, Musk found himself making a public appearance where he had to come up with a new batch of excuses for a delay. Reminded about the initial 2003 target date to fly the Falcon 1, Musk acted shocked. “Are you serious?” he said. “We said that? Okay, that’s ridiculous. I think I just didn’t know what the hell I was talking about. The only thing I had prior experience in was software, and, yeah, you can write a bunch of software and launch a website in a year. No problem. This isn’t like software.\n\nSeptember 12, 2018\n\u001c244\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo, I think generally you do want to have a timeline where, based on everything you know about, the schedule should be X, and you execute towards that, but with the understanding that there will be all sorts of things that you don’t know about that you will encounter that will push the date beyond that. It doesn’t mean that you shouldn’t have tried to aim for that date from the beginning because aiming for something else would have been an arbitrary time increase. It’s different to say, “Well, what do you promise people?” Because you want to try to promise people something that includes schedule margin. But in order to achieve the external promised schedule, you’ve got to have an internal schedule that’s more aggressive than that. Sometimes you still miss the external schedule.\n\nSeptember 13, 2018\n\u001c245\n\u0011\n\u0011"},{"ty":