ript type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunk = [{"ty":"is","ibi":31119,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSpaceX, by the way, is not alone here. Being late is par for the course in the aerospace industry. It’s not a question of if it’s late, it’s how late will the program be. I don’t think an aerospace program has been completed on time since bloody World War II.\n\nSeptember 13, 2018\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cDealing with the epically aggressive schedules and Musk’s expectations has required SpaceX’s engineers to develop a variety of survival techniques. Musk often asks for highly detailed proposals for how projects will be accomplished. The employees have learned never to break the time needed to accomplish something down into months or weeks. Musk wants day-by-day and hour-by-hour forecasts and sometimes even minute-by-minute countdowns, and the fallout from missed schedules is severe. “You had to put in when you would go to the bathroom,” Brogan said. “I’m like, ‘Elon, sometimes people need to take a long dump.’”\n\nSeptember 12, 2018\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhere a typical manager may set the deadline for the employee, Musk guides his engineers into taking ownership of their own delivery dates. “He doesn’t say, ‘You have to do this by Friday at two P.M.,’” Brogan said. “He says, ‘I need the impossible done by Friday at two P.M. Can you do it?’ Then, when you say yes, you are not working hard because he told you to. You’re working hard for yourself. It’s a distinction you\n\nSeptember 12, 2018\n\u001c246\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccan feel. You have signed up to do your own work.” And by recruiting hundreds of bright, self-motivated people, SpaceX has maximized the power of the individual. One person putting in a sixteen-hour day ends up being much more effective than two people working eight-hour days together. The individual doesn’t have to hold meetings, reach a consensus, or bring other people up to speed on a project. He just keeps working and working and working. The ideal SpaceX employee is someone like Steve Davis, the director of advanced projects at SpaceX. “He’s been working sixteen hours a day every day for years,” Brogan said. “He gets more done than eleven people working together.”\n\nSeptember 12, 2018\n\u001c247\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccan feel. You have signed up to do your own work.” And by recruiting hundreds of bright, self-motivated people, SpaceX has maximized the power of the individual. One person putting in a sixteen-hour day ends up being much more effective than two people working eight-hour days together. The individual doesn’t have to hold meetings, reach a consensus, or bring other people up to speed on a project. He just keeps working and working and working. The ideal SpaceX employee is someone like Steve Davis, the director of advanced projects at SpaceX. “He’s been working sixteen hours a day every day for years,” Brogan said. “He gets more done than eleven people working together.”\n\nSeptember 12, 2018\n\u001c247\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMusk rewarded all of this toil and angst with one of his standard responses. He wrote back, “Ok.” The actuator Davis designed ended up costing $3,900 and flew with Falcon 1 into space. “I put every ounce of intellectual capital I had into that e-mail and one minute later got that simple response,” Davis said. “Everyone in the company was having that same experience. One of my favorite things about Elon is his ability to make enormous decisions very quickly. That is still how it works today.”\n\nSeptember 13, 2018\n\u001c249\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSpaceX reinvigorated Watson, who had become disenchanted with JPL’s acceptance of wasteful spending and bureaucracy. Musk had to sign off on every expenditure over $10,000. “It was his money that we were spending, and he was keeping an eye on it, as he damn well should,” Watson said. “He made sure nothing stupid was happening.” Decisions were made quickly during weekly meetings, and the entire company bought into them. “It was amazing how fast people would adapt to what came out of those meetings,” Watson said. “The entire ship could turn ninety degrees instantly. Lockheed Martin could never do anything like that.” Watson continued: Elon is brilliant. He’s involved in just about everything. He understands everything.\n\nSeptember 13, 2018\n\u001c250\n\u0011\n\u0011"},{"ty":"te","id":"i.58","spi":31128},{"ty":"te","id":"i.59","spi":31428},{"ty":"te","id":"i.60","spi":32087},{"ty":"te","id":"i.61","spi":32549},{"ty":"te","id":"i.62","spi":33267},{"ty":"te","id":"i.63","spi":33985},{"ty":"te","id":"i.64","spi":34522},{"ty":"as","st":"paragraph","si":31119,"ei":31119,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":31120,"ei":31120,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":31121,"ei":31121,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":31123,"ei":31123,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":31125,"ei":31125,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":