ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":33988,"ei":34485,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Verdana","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":34486,"ei":34505,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":34525,"ei":35252,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Verdana","ts_it_i":false,"ts_bgc":"#fde096","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":35253,"ei":35272,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime('', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunk = [{"ty":"is","ibi":35280,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI don’t want to be the person who ever has to compete with Elon. You might as well leave the business and find something else fun to do. He will outmaneuver you, outthink you, and out-execute you.\n\nSeptember 13, 2018\n\u001c251\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe guiding principle at SpaceX is to embrace your work and get stuff done. People who await guidance or detailed instructions languish. The same goes for workers who crave feedback. And the absolute worst thing that someone can do is inform Musk that what he’s asking is impossible. An employee could be telling Musk that there’s no way to get the cost on something like that actuator down to where he wants it or that there is simply not enough time to build a part by Musk’s deadline. “Elon will say, ‘Fine. You’re off the project, and I am now the CEO of the project. I will do your job and be CEO of two companies at the same time. I will deliver it,’” Brogan said. “What’s crazy is that Elon actually does it.\n\nSeptember 13, 2018\n\u001c253\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“His biggest enemy will be himself and the way he treats people,” this person said.\n\nSeptember 13, 2018\n\u001c256\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cLater, in high school, Shotwell’s mom forced her to attend a lecture at the Illinois Institute of Technology on a Saturday afternoon. As Shotwell listened to one of the panels, she grew enamored with a fifty-year-old mechanical engineer. “She had these beautiful clothes, this suit and shoes that I loved,” Shotwell said. “She was tall and carried off the heels really well.” Shotwell chatted with the engineer after the talk, learning about her job. “That was the day I decided to become a mechanical engineer,” she said.\n\nSeptember 13, 2018\n\u001c257\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHer deal-making skills extended to negotiating the big-ticket contracts with NASA that kept SpaceX alive during its leanest years, including a $278 million contract in August 2006 to begin work on vehicles that could ferry supplies to the ISS. Shotwell’s track record of success turned her into Musk’s ultimate confidante at SpaceX, and at the end of 2008, she became president and chief operating officer at the company.\n\nSeptember 13, 2018\n\u001c259\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“Elon is changing the way aerospace business is done,” said NASA’s Stoker. “He’s managed to keep the safety factor up while cutting costs. He’s just taken the best things from the tech industry like the open-floor office plans and having everyone talking and all this human interaction. It’s a very different way to most of the aerospace industry, which is designed to produce requirements documents and project reviews.”\n\nSeptember 13, 2018\n\u001c268\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSome at SpaceX who have not been through a public company experience may think that being public is desirable. This is not so. Public company stocks, particularly if big step changes in technology are involved, go through extreme volatility, both for reasons of internal execution and for reasons that have nothing to do with anything except the economy. This causes people to be distracted by the manic-depressive nature of the stock instead of creating great products.\n\nSeptember 13, 2018\n\u001c272\n\u0011\n\u0011\n\n\n10         THE REVENGE OF THE ELECTRIC CAR\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe Model S beat out eleven other vehicles from companies such as Porsche, BMW, Lexus, and Subaru and was heralded as “proof positive that America can still make great things.” Motor Trend celebrated the Model S as the first non–internal combustion engine car ever to win its top award and wrote that the vehicle handled like a sports car, drove as smoothly as a Rolls-Royce, held as much as a Chevy Equinox, and was more efficient than a Toyota Prius. Several months later, Consumer Reports gave the Model S its highest car rating in history—99 out of 100—while proclaiming that it was likely the best car ever built. It was at about this time that sales of the Model S started to soar alongside Tesla’s share price and that General Motors, among other automakers, pulled together a team to study the Model S, Tesla, and the methods of Elon Musk.\n\nSeptember 13, 2018\n\u001c279\n\u0011\n\u0011"},{"ty":"te","id":"i.65","spi":35289},{"ty":"te","id":"i.66","spi":35526},{"ty":"te","id":"i.67","spi":36282},{"