c5e1a5","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":38368,"ei":38387,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":38398,"ei":38451,"sm":{"ts_un":false,"ts_un_i":true,"ts_it_i":false,"ts_fs_i":false,"ts_ff_i":false,"ts_fgc":"#000000","ts_fgc_i":true,"ts_it":true,"ts_bd_i":false,"ts_va_i":true,"ts_fs":16.0,"ts_ff":"Verdana","ts_bd":false}},{"ty":"as","st":"text","si":38452,"ei":39300,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#000000","ts_un_i":true,"ts_fgc_i":true,"ts_it":true,"ts_fs":13.0,"ts_ff":"Verdana","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":39301,"ei":39320,"sm":{"ts_ff_i":false,"ts_un":false,"ts_fgc":"#757575","ts_un_i":true,"ts_fgc_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime('', DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="zRVLsZPmaiHV89uk0mihmzwo56E">DOCS_modelChunk = [{"ty":"is","ibi":39328,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe savvy engineers knew better than to go into a meeting and deliver bad news without some sort of alternative plan at the ready. “One of the scariest meetings was when we needed to ask Elon for an extra two weeks and more money to build out another version of the Model S,” Javidan said. “We put together a plan, stating how long things would take and what they would cost. We told him that if he wanted the car in thirty days it would require hiring some new people, and we presented him with a stack of resumes. You don’t tell Elon you can’t do something. That will get you kicked out of the room. You need everything lined up. After we presented the plan, he said, ‘Okay, thanks.’ Everyone was like, ‘Holy shit, he didn’t fire you.’”\n\nSeptember 14, 2018\n\u001c302\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou did what Musk asked or were prepared to burrow down into the properties of materials to explain why something could not be done. “He always said, ‘Take it down to the physics,’” Javidan said.\n\nSeptember 14, 2018\n\u001c303\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTesla, he said, wanted to turn the Model S into more than a car. Ideally it would be an object of desire just like the iPod and iPhone.\n\nSeptember 14, 2018\n\u001c312\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhat Musk had done that the rival automakers missed or didn’t have the means to combat was turn Tesla into a lifestyle. It did not just sell someone a car. It sold them an image, a feeling they were tapping into the future, a relationship.\n\nSeptember 14, 2018\n\u001c320\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe guys like Straubel who had been at Tesla since the beginning are quick to remind people that the chance to build an awesome electric car had been there all along. “It’s not really like there was a rush to this idea, and we got there first,” Straubel said. “It is frequently forgotten in hindsight that people thought this was the shittiest business opportunity on the planet. The venture capitalists were all running for the hills.” What separated Tesla from the competition was the willingness to charge after\n\nSeptember 14, 2018\n\u001c323\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cits vision without compromise, a complete commitment to execute to Musk’s standards.\n\nSeptember 14, 2018\n\u001c323\n\u0011\n\u0011\n\n\n11         THE UNIFIED FIELD THEORY OF ELON MUSK\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere’s the whole Iron Man thing in which he’s presented as a cartoonish businessman—this very unusual animal at the zoo. But there is now a degree to which you have to ask whether his success is an indictment on the rest of us who have been working on much more incremental things. To the extent that the world still doubts Elon, I\n\nSeptember 15, 2018\n\u001c328\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthink it’s a reflection on the insanity of the world and not on the supposed insanity of Elon.” SolarCity, like the rest of Musk’s ventures, did not represent a business opportunity so much as it represented a worldview. Musk had decided long ago—in his very rational manner—that solar made sense. Enough solar energy hits the Earth’s surface in about an hour to equal a year’s worth of worldwide energy consumption from all sources put together.20 Improvements in the efficiency of solar panels have been happening at a steady clip. If solar is destined to be mankind’s preferred energy source in the future, then this future ought to be brought about as quickly as possible.\n\nSeptember 15, 2018\n\u001c329\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I’ve learned that your intuition about things you don’t know that much about isn’t very good,” Page said. “The way Elon talks about this is that you always need to start with the first principles of a problem. What are the physics of it? How much time will it take? How much will it cost? How much cheaper can I make it? There’s this level of engineering and physics that you need to make judgments about what’s possible and interesting. Elon is unusual in that he knows that, and he also knows business and organization and leadership and governmental issues.”\n\nSeptember 15, 2018\n\u001c358\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001c“I don’t think we’re doing a good job as a society deciding what things are really important to do,” Page said. “I think like we’re just not educating people in this kind of general way. You should have a pretty broad engineering and scientific background. You should have some leadership training and a bit of MBA training or knowledge of how to run things, organize stuff, and raise money. I don’t think most people are doing that, and it’s a big problem. Engineers are usually trained in a very fixed area. When you’re able to think about all of these disciplines together, you kind of think differently and can dream of much crazier things and how they might work. I think that’s really an important thing for the world. That’s how we make progress.”\n\nSeptember 15, 2018\n\u001c360\n\u0011\n\u0011"},{"ty":"te","id":"i.73","spi":39337},{"ty":"te","id":"i.74","spi":40116},{"ty":"te","id":"i.75","spi":40352},{"ty":"te","id":"i.76","spi":40528},{"ty":"te","id":"i.77","spi":40808},{"ty":"te","id":"i.78","spi":41363},{"ty":"te","id":"i.79","spi":41539},{"ty":"te","id":"i.80","spi":41912},{"ty":"te","id":"i.81","spi":42629},{"ty":"te","id":"i.82","spi":43232},{"ty":"as","st":"paragraph","si":39328,"ei":39328,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"paragraph","si":39329,"ei":39329,"sm":{"ps_klt_i":true,"ps_sb_i":true,"ps_awao_i":true,"ps_ls":1.0,"ps_sa_i":true,"ps_sm_i":true,"ps_kwn_i":true,"ps_ifl_i":true,"ps_ls_i":true,"ps_il_i":true,"ps_ir_i":true,"ps_al_i":true}},{"ty":"as","st":"tbl","si":39330,"ei":39330,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":468.0,"col_wt":0}]}},"tbls_bw":0.75,"tbls_bc":"#bdbdbd"}},{"ty":"as","st":"cell","si":39332,"ei":39332,"sm":{"cell_pb_i":false,"cell_pr_i":false,"cell_pt_i":false,"cell_pt":0.0,"cell_pb":0.0,"cell_pr":0.0,"cell_pl_i":false,"cell_pl":0.0}},{"ty":"as","st":"tbl","si":39334,"ei":39334,"sm":{"tbls_cols":{"cv":{"op":"set","opValue":[{"col_wv":54.0,"col_wt":0},{"col_wv":358.5,"col_wt":0},{"c